import React from "react";
const AboutList = () => {
    return (
        <div id="list__container">
            <ul className="list">
                <li>Fiabilité</li>
                <li>Respect</li>
                <li>Service</li>
                <li>Sécurité</li>
            </ul>
        </div>
       
    );
    }
export default AboutList;
